INSERT INTO `article` (`id`, `createDate`, `modifyDate`, `author`, `content`, `hits`, `htmlFilePath`, `isPublication`, `isRecommend`, `isTop`, `metaDescription`, `metaKeywords`, `pageCount`, `title`, `articleCategory_id`) VALUES
	('402881882ba8753a012ba883e8b20002', '2010-10-14 10:13:58', '2015-01-04 14:21:24', 'admin', '<div>\r\n<table border="0" cellspacing="0" cellpadding="0" width="700">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<div>\r\n<table border="0" cellspacing="0" cellpadding="0" width="680">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><strong>一、挑选商品</strong><br /><br /><strong>二、放入购物车（立即购买）</strong><br /><br /><strong>三、提交订单（进入结算中心）</strong></p>\r\n<p>1、用户登录、注册<br />如果您未在商城注册登录过，可选择&ldquo;注册&rdquo;；<br />如果您已是商城注册会员，直接&ldquo;登录&rdquo;即可。<br />小贴士：注册只需花费您一分钟时间，并且注册用户享受更多优惠。</p>\r\n<p>2、填写收货人信息<br />为了保证您的商品顺利送达目的地，请准确填写收货人的姓名、地址、邮编、电话等有效信息；<br />需要发票的用户，请在备注里注明发票台头，商城所开发票均为正规发票，所开金额均为订单的实际金额（不包括运费），当月订单请在当月补开发票，过期不受理，如有退换货需将发票一起寄回。</p>\r\n<p>3、选择送货方式<br />根据您所在的地区填写送货方式。运费价格及范围请参见&ldquo;配送费用收取标准&rdquo;。</p>\r\n<p>4、选择支付方式<br />我们提供的支付方式有：支付宝、财付通、货到付款，网上银行支付，邮局汇款和邮局网汇通汇款等。</p>\r\n<p>5、确认订单，并提交<br />完成上述所有流程后，您可以点击&ldquo;确认无误 提交订单&rdquo;按钮，订单提交后页面会提示订单号，进入&ldquo;个人中心&rdquo;即可查询订单状态。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>四、立即付款<br /></strong>订单提交成功后，请按照您所选择的付款方式立即支付；下单后，订单将保留三天，三天后若仍未付款将自动取消。</p>\r\n<p>&nbsp;</p>\r\n<p><strong>五、收货和评价<br /></strong>正常情况下，到货时间一般3-5天不等（除天气灾害等延误）。<br />收到货后，请对我们的商品进行评价哦！</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 481, '/html/article_content/201010/9102600e47b7401b843ad3722e1e9b70.html', b'1', b'1', b'0', '新手购物流程', '购物,流程', 1, '购物流程', '402881882ba8455f012ba86db8560006'),
	('402881882ba8753a012ba88eb79a0003', '2010-10-14 10:25:46', '2015-01-04 14:21:32', 'admin', '<p>会员定期巡检制度</p>\r\n<p>一、目的 <br />为确保网站注册会员资料和会员发布信息的真实可靠性，特制定本制度。</p>\r\n<p>二、人员安排及巡检职责&nbsp;&nbsp; <br />1. 内容主管对整个平台负全责，巡检人员负责整个网站注册会员资料和会员发布信息的检查、审核、激活。网络信息安全管理小组负责管理各信息审核员，并对经信息审核员审核通过的内容进行监管。<br />2. 如巡检人员缺勤，则部门主管须及时安排其他人员巡检。节假日，须安排值班人员巡检会员信息。&nbsp; <br />3. 巡检周期为：当天全面检查，一周抽查一次，一月普查一次。</p>\r\n<p>三、巡检细则&nbsp;&nbsp; <br />1. 会员注册资料检查&nbsp; <br />1.1. 每天下班前全面检查当天注册的会员资料，如果发现注册资料中包含有害、虚假、诽谤或中伤他人的信息，马上予以删除。<br />1.2. 每周五对一周的注册信息进行抽查，每个月底对一个月的注册信息抽查一次，主要以搜索特定关键字为主。</p>\r\n<p>2. 会员在网站上发布的信息检查&nbsp; <br />2.1. 会员发布的企业和产品信息：<br />2.1.1. 巡检人员当天检查，审核通过后才在网站前台显示。<br />2.1.2. 审核没有通过，如果原因是不够完善，及时告知会员补充完整；如果信息本身包含有害、虚假、诽谤或中伤他人的内容，直接予以删除。<br />2.2. 会员发布的供求等商业信息：<br />2.2.1. 巡检人员根据信息发布的频率，定期检查，一般15分钟检查一次。&nbsp; <br />2.3. 检查到会员发布的信息本身包含有害、虚假、诽谤或中伤他人等内容，直接予以删除。</p>\r\n<p>3. 纠错举报处理&nbsp; <br />网站上设置纠错举报用联系方式，该联系人每天查收相关邮件或接听相关电话，及时处理用户反映的会员信息问题，仔细求证，及时回复。</p>\r\n<p>四、巡检要点 <br />1. 关键时段检查：每日上午开始上班30分钟内完成会员注册资料和会员发布信息的第一遍检查。下午离下班前30分钟左右开始最后一遍检查。</p>\r\n<p>2. 按频率检查：部门主管根据需要，设置巡检频率。巡检人员根据巡检频率对会员发布的信息进行检查与维护。</p>\r\n<p>3. 巡检内容：包括所有注册会员资料和会员在网站上发布的各种信息。删除有害信息、虚假、重发、滥发等信息。<br />3.1. 有害信息：网站发布的各类信息必须严格遵守《中华人民共和国计算机信息网络国际联网管理暂行规定》、《互联网信息服务管理办法》等有关国家政策、法规规定。会员不得编辑和传播下列信息：</p>\r\n<p>（一）反对宪法所确定的基本原则的；</p>\r\n<p>（二）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</p>\r\n<p>（三）损害国家荣誉和利益的；</p>\r\n<p>（四）煽动民族仇恨、民族歧视，破坏民族团结的；</p>\r\n<p>（五）破坏国家宗教政策，宣扬邪教和封建迷信的；</p>\r\n<p>（六）散布谣言，扰乱社会秩序，破坏社会稳定的；</p>\r\n<p>（七）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</p>\r\n<p>（八）侮辱或者诽谤他人，侵害他人合法权益的；</p>\r\n<p>（九）含有法律、行政法规禁止的其他内容的。</p>\r\n<p><br />巡检人员可用关键字检索（必要时请用模糊检索方法检索栏目信息）。发现有害信息，请快速作好信息备份（保留原始记录：所发内容、用户IP、登陆时间、注册时间、最后访问时间），并且对该ID所有帖子进行逐个审核，然后立即删除有害信息，并上报部门主管。部门主管须通过技术手段：黑名单控制+定期的数据库检查（一周）, 处理此类信息。如情节严重者，部门主管须通过信息网络安全管理小组上报管理机关！</p>\r\n<p>3.2. 虚假信息：发布内容明显与事实不符的信息；&nbsp;</p>\r\n<p>3.3. 诽谤、中伤他人的信息：信息中出现恶意辱骂某公司或个人的字眼，此类信息常出现在论坛和专家等交互式栏目中。如有此类信息，巡检人员在活跃人气的同时须正确引导，若情节严重则立即删除；</p>\r\n<p>3.4. 与栏目不符的信息：信息内容与栏目主旨（即栏目名称或子栏目名称）不符或欠符合的信息。&nbsp;</p>\r\n<p>3.5. 重发、滥发的信息：同条信息一个栏目中只准发布一次，并且只准被发布到一个栏目或子栏目下，否则都视为重发；屡次重发且每次每一条被重发的信息数量都在5条以上的，或屡次长时间重发，每次一发就是5分钟以上的，都视为滥发。巡检人员只需保留最新一条，其余删除。必要时，加入黑名单屏蔽其发布功能；</p>\r\n<p>3.6 乱码信息：在页面上呈现为乱码的信息。在排除网站自身技术问题后，应立即删除或修正此类信息。&nbsp;</p>\r\n<p>本制度解释权归xxxx有限公司所有</p>\r\n<p>&nbsp;</p>\r\n<p>网上隐私保护制度</p>\r\n<p>第一条 为促进电子商务健康发展，加强信息共建共享，推进网上隐私权保护制度化、规范化，切实维护网民的权利，根据相关规定，制定本制度。</p>\r\n<p>第二条 鉴于网络的特性，为了使用户正确有效地使用网站的功能与服务，并便于向用户提供优质高效的服务，网站会提示用户进行注册、填写表单等方式提交其个人资料。<br />公司服务部门根据栏目要求，对信息进行审核。如发现用户提交的资料存在虚假、违法内容，相关工作人员可删除该资料并终止该用户的服务。<br />公司技术部须使用相应技术，对用户所提供的资料进行严格的管理和保护，防止个人资料丢失、被盗用或遭窜改。</p>\r\n<p>第三条 公司服务部门可通过技术手段实现用户自行阅览、补充、修改、删除其资料的功能，或根据用户要求，提供相关服务。</p>\r\n<p>第四条 在未经用户同意及确认之前，公司不得将用户所提供的个人资料提供给第三方。除非当政府机关依照法定程序要求本网站披露个人资料时，本网站将根据执法单位之要求或为公共安全之目的提供个人资料。</p>\r\n<p>第五条 公司服务部须在网站页面提示&ldquo;隐私权保护声明&rdquo;（如附件），说明网站对用户个人信息所采取的收集、使用和保护政策。</p>\r\n<p>本制度最终解释权属xxxx有限公司所有。</p>\r\n<p>&nbsp;</p>\r\n<p>附：xxx私权保护声明</p>\r\n<p>xxx隐私权保护声明</p>\r\n<p>xxx（以下称&ldquo;本网站&rdquo;）隐私权保护声明系本网站保护用户个人隐私的承诺。鉴于网络的特性，本网站将无可避免地与您产生直接或间接的互动关系，故特此说明本网站对用户个人信息所采取的收集、使用和保护政策，请您务必仔细阅读：</p>\r\n<p>一、搜集、分拣信息<br />当您浏览、阅读或下载本网站的信息时，网站会自动搜集和分拣到您的信息（互联网域名、用户使用的浏览器和操作系统类型、访问时间、访问页面），这些信息不会被用来确定您的身份。</p>\r\n<p>二、个人资料及披露 <br />当您在本网站进行用户注册登记、参加有关活动时，在您的同意并确认下，本网站会通过注册表格、订单等形式要求您提供一些个人资料。<br />个人资料包括但不限于姓名、性别、年龄、地址、邮编、电话、传真、电子邮件。您必须保证提供资料的准确、真实、有效和完整。我们保留随时删除虚假个人资料并终止服务的权利 。<br />收集个人资料是为了使您正确的使用xxx的功能与服务，并便于我们向您提供优质高效的服务。</p>\r\n<p>在未经您同意及确认之前，本网站不会将您所提供的个人资料利用于上述外的其它目的。除非当政府机关依照法定程序要求本网站披露个人资料时，本网站将根据执法单位之要求或为公共安全之目的提供个人资料。在此情况下之任何披露，本网站均得免责。</p>\r\n<p>三、信息安全&nbsp; <br />本网站将使用相应的技术，对您所提供的个人资料进行严格的管理和保护，防止个人资料丢失、被盗用或遭窜改。为保护个人信息，必要时本网站会委托专业技术人员对所述资料进行相应处理，并将处理安排及时通知您，若您未在通知规定的时间内主动明示反对，本网站将推定您已同意。但处理过后，您仍然有权请求停止电脑处理。</p>\r\n<p>四、用户权利<br />在本网站上，您对自己拥有的个人资料享有以下权利：<br />（一）随时查询及请求阅览；<br />（二）随时请求补充或更正；<br />（三）随时请求删除； <br />（四）请求停止电脑处理及利用。&nbsp; <br />您可通过联系电话（8888- 88888888）提出请求，本网站会为您提供相关服务。</p>\r\n<p>五、限制利用原则&nbsp; <br />本网站惟在符合下列条件之一，方对收集之个人资料进行必要范围以外之利用： <br />（一）已取得您的书面同意；<br />（二）为免除您在生命、身体或财产方面之急迫危险； <br />（三）为防止他人权益之重大危害； <br />（四）为增进公共利益，且无损于您的重大利益。</p>\r\n<p>六、披露个人资料&nbsp; <br />当政府机关依照法定程序要求本网站披露个人资料时，本网站将根据其要求或为了公共安全的目的提供个人资料；这种情况下的任何披露，本网站均得免责。</p>\r\n<p>七、公共论坛&nbsp; <br />本网站为您提论坛、咨询等服务。在这些区域内，您公布的任何信息都会成为公开的信息。因此，我们提醒并请您慎重考虑是否有必要在这些区域公开您的个人信息。</p>\r\n<p>八、Cookies使用原则 <br />Cookies是指一种技术，当使用者访问设有Cookies装置的本网站时，本网站之服务器会自动发送Cookies至阁下浏览器内，并储存到您的电脑硬盘内，此Cookies便负责记录日后您到访本网站的种种活动、个人资料、浏览习惯、消费习惯甚至信用记录。运用Cookies技术，本网站能够为您提供更加周到的个性化服务。本网站将会运用Cookies储存密码，以便您造访本网站时不必每次重复输入密码。</p>\r\n<p>九、免责 <br />除上述有关免责规定外，下列情况时本网站亦无需承担任何责任： <br />（一）由于您将用户密码告知他人或与他人共享注册帐户，由此导致的任何个人信息的泄露。<br />（二）任何由于黑客政击、计算机病毒侵入或发作、因政府管制而造成的暂时性关闭等影响网络正常经营之不可抗力而造成的个人信息泄露、丢失、被盗用或被窜改等。&nbsp; <br />（三）由于本网站不拥有或不控制的公司以及我们不雇佣或不管理的人员所造成的个人信息的泄露及由此而导致的任何法律争议和后果。<br />（四）由于与本网站链接的其它网站所造成之个人资料泄露及由此而导致的任何法律争议和后果。</p>\r\n<p>本网站隐私权保护申明的修改及更新权均属于xxx。</p>\r\n<p>&nbsp;</p>\r\n<p>网站投诉兴报咨询处制度</p>\r\n<p>第一条 为促进电子商务健康发展，加强信息共建共享，推进网上投诉举报制度化、规范化，切实维护网民的知情权、参与权、表达权，根据相关规定，制定本制度。</p>\r\n<p>第二条 网上投诉举报受理职能由嘉兴市麦包包皮具有限公司服务部承担，行政部门主管。<br />技术部负责网上投诉举报系统维护、更新和升级。</p>\r\n<p>第三条 各网站设客服人员负责投诉举报咨询受理工作，部门主管为监督员，并指定专人具体负责办理。</p>\r\n<p>第四条 对投诉举报信息的处理，坚持实事求是、公正公开和廉洁高效原则。</p>\r\n<p>第五条 处理咨询信息的时限为1个工作日，投诉举报信息时限为2个工作日。情况复杂的，经本部门负责人同意，可适当延长处理时限，但最多不超过5个工作日。</p>\r\n<p>第六条 受理人在对投诉举报信息汇总分类后，按照职责分工，及时分送相关负责人。 <br />对非本网站的投诉举报信息，受理人应转送相关部门，或退回投诉举报人并说明理由。</p>\r\n<p>第七条 相关责任人收到分送的投诉举报信息后，应及时组织核查。</p>\r\n<p>第八条 各部门或相关人员应当积极支持和配合核查工作，并如实提供相关材料。</p>\r\n<p>第九条 责任人根据核查情况，提出答复意见，并登记备案，同时通过电话、信函或电子邮件方式回复投诉举报人。</p>\r\n<p>第十条 客服人员定期将投诉举报咨询处理情况汇总上报部门领导，并通报有关部门及人员。</p>\r\n<p>本制度最终解释权属xxxx有限公司所有。</p>', 541, '/html/article_content/201010/90eb7634990341909027a5e20245b3e1.html', b'1', b'1', b'0', '会员应遵守的网站制度', '制度', 3, '网站制度', '402881882ba8455f012ba86db8560006'),
	('402881882ba8753a012ba891884e0004', '2010-10-14 10:28:51', '2015-01-04 14:21:39', 'admin', '<p>登陆后，进入&ldquo;个人中心&rdquo;可查询到订单状态。</p>\r\n<p>1、未确认/未付款：订单尚未获得确认，正常工作时间内，最迟2小时可以获得确认，如非正常工作时间，需要等到上班时间确认。</p>\r\n<p><br />2、已确认/未付款：订单已获得确认，请按照确认后的总金额付款，付款完毕后可返回&ldquo;个人中心&rdquo;查看订单状态，银行汇款的用户需要提交汇款信息，内容为：交易流水号、汇款时间、 汇入行、汇入卡号、汇款金额共５项。系统自动保留订单期限为3天，超过3天未付款的订单，系统会自动将订单取消。</p>\r\n<p>&nbsp;<br />3、已付款/待发货：这时订单已在我们工作人员的处理流程中。</p>\r\n<p><br />4、已发货/待收货：您的货物已经发出，请您稍后注意查收，订单详细中可查到快递公司和快递单号。</p>\r\n<p>&nbsp;<br />5、交易成功：订单已成功完成交易，请对我们的商品进行评论，如收到产品有质量问题，请直接与售后部门联系。</p>', 777, '/html/article_content/201010/50588403d9dd494c9035fa763e49e112.html', b'1', b'1', b'0', '订单的状态', '订单', 1, '订单查询', '402881882ba8455f012ba86db8560006'),
	('402881882ba8753a012ba892f6160005', '2010-10-14 10:30:25', '2015-01-04 14:21:49', 'admin', '<p>问：<strong>商城所售商品都是正品行货吗？有售后保修吗？</strong></p>\r\n<p>答：商城所售商品都是正品行货，均自带机打发票。凭商城发票，所有商品都可以享受生产厂家的全国联保服务。商城将严格按照国家三包政策，针对所售商品履行保修、换货和退货的义务。您也可以到商城任一分公司售后部享受售后服务。</p>\r\n<p>问：<strong>购买的商品能开发票？如果是公司购买，可以开增值税发票吗？</strong></p>\r\n<p>答：商城所售商品都是正品行货，每张订单均自带中文机打的&ldquo;商品专用发票&rdquo;，此发票可用作单位报销凭证。 发票会随包裹一同发出，发票金额含配送费金额。<br />企业客户在提供《一般纳税人证书》、《营业执照》、《税务登记证》、《开户许可证》四类证件复印件后，可向开取增值税发票，开好后，商城会以快递方式为您寄出。</p>\r\n<p>问：<strong>无货商品什么时候能到货？</strong></p>\r\n<p>答：无货商品的到货时间根据配货情况而不同，无法准确估计，但您可以使用&ldquo;到货通知&rdquo;功能，一旦商品有货，我们会通过电子邮件等方式通知您。</p>\r\n<p>问：<strong>下单后何时可以收到货？</strong></p>\r\n<p>答：在商品有现货的情况下，北京、上海、广州客户，下单后一般24小时内可收到货（郊区县配送时间可能会更长一些）；<br />其它地区用户，将根据您的收货地址及所选择的配送方式而不同，一般到货时间在1-7天（极偏远地区配送时间可能会更长一些）；<br />如果商品处于预订或在途状态，那么还应加上调配货时间。</p>\r\n<p>问：<strong>在线支付支持哪些银行卡？支持大额支付吗？</strong></p>\r\n<p>答：我们为您提供几乎全部银行的银行卡及信用卡在线支付，只要您开通了&ldquo;网上支付&rdquo;功能，即可进行在线支付，无需手续费，实时到帐，方便快捷。（如客户原因取消订单退款，则需要客户承担1%平台手续费）如您订单金额较大，可以使用快钱支付中的招行、工行、建行、农行、广发进行一次性大额支付（一万元以下）。</p>\r\n<p>问：<strong>下单时可以指定送货时间吗？</strong></p>\r\n<p>答：可以，您下单时可以选择&ldquo;只工作日送货(双休日、假日不用送)&rdquo;、&ldquo;工作日、双休日与假日均可送货&rdquo;、&ldquo;只双休日、假日送货(工作日不用送)&rdquo;等时间类型，并选择是否提前电话确认。<br />另外，您还可以在订单备注里填写更具体的需求，我们会尽量满足您的要求。</p>\r\n<p>问：<strong>收货时发现问题可以拒收吗？</strong></p>\r\n<p>答：在签收货物时如发现货物有损坏，请直接拒收退回我公司，相关人员将为您重新安排发货。</p>\r\n<p>问：<strong>如果我刚刚下单商品就降价了，能给我补偿吗？</strong></p>\r\n<p>答：商城的商品价格随市场价格的波动每日都会有涨价、降价或者优惠等变化。如果下完订单后价格发生了变化，可到&ldquo;我的商城&rdquo;自主申请价格保护。</p>\r\n<p>问：<strong>下单后，我能做什么？</strong></p>\r\n<p>答：如果是在线支付方式，请您尽快完成付款，待付款被确认后我们会立即为您发货，如果选择自提或货到付款，您可以进入&ldquo;个人中心&rdquo;，在&ldquo;订单列表&rdquo;中找到您的订单，然后可随时查看订单处理状态，做好收货或者上门自提的准备。<br />在您成功购物后，您还可以发表商品评价，向其他用户分享商品使用心得。</p>\r\n<p>问：<strong>为什么我无法登陆商城？</strong></p>\r\n<p>答：首先要检查您的用户名、密码是否正确，确认您的浏览器是否支持COOKIE。</p>\r\n<p>问：<strong>产品如何保修？</strong></p>\r\n<p>答：商城销售的商品都以商品说明中的保修承诺为准。</p>\r\n<p>问：<strong>订单得到确认后我该做什么？</strong></p>\r\n<p>答：按照订单所提示的实际应汇款金额，汇款至该订单所在的公司账号内，汇款交易成功后，登陆&ldquo;个人中心&rdquo;查看您的订单，在订单中的&ldquo;汇款备注&rdquo;中输入您的相关汇款信息(例如：汇入行、汇入我司银行账号的实际金额、汇款日期和汇入账号、订单号等），等待我司财务人员确认汇款。</p>\r\n<p>问：<strong>汇款确认后多久能够将货物发出？</strong></p>\r\n<p>答：正常情况下会在工作时间24-48小时内可以将您的货物发出。</p>\r\n<p>问：<strong>非商品自身质量问题是否可以退货？</strong></p>\r\n<p>答：部分商品在不影响二次销售的情况下，加收一定的退货手续费，是可以办理退货的，详情请查看&ldquo;退换货政策&rdquo;</p>\r\n<p>问：<strong>在哪进行在线支付？</strong></p>\r\n<p>答：在商城首页的&ldquo;会员登录&rdquo;中输入用户名和密码进行登陆，登陆后点击&ldquo;个人中心&rdquo;，进入 &ldquo;在线支付&rdquo;，点击进入后就可以进行在线支付了。</p>\r\n<p>问：<strong>工作时间？</strong></p>\r\n<p>答：客服中心受理热线电话及订单处理时间为周一至周日9：00&mdash;24：00。<br />注：如遇国家法定节假日，则以商城新闻发布放假时间为准，请大家届时关注。</p>\r\n<p>问：<strong>如何将退款打回银行卡？</strong></p>\r\n<p>答：在投诉中心留言相关信息，如银行卡的开户行(详细到支行）、开户姓名、卡号，相关人员会为您处理，退款周期视您的货物是否发出而定，如果货物未出库发出，退款会在三个工作日内完成；如果货物已发出，则需货物返回我司物流中心后为您办理退款。</p>\r\n<p>问：<strong>商品包装问题？</strong></p>\r\n<p>答：我公司所发送商品均由专人进行打包，商品在未签收前都由我公司负责，如在收到商品时发现包装有破损或是其它方面问题，请直接致电我公司客服，客服人员会帮您解决。</p>\r\n<p>问：<strong>订单付款后，如果长时间未收到货，我是否可以申请办理退款？</strong></p>\r\n<p>答：非商城快递覆盖区域内，由第三方快递公司负责直接送达的订单，如圆通快递，自发货时间算起超过10天仍未收到货或收货地址超出第三方快递覆盖的区域，由第三方快递转邮政，如圆通转EMS等，自发货时间算起超过20天仍未收到货，可致电客服中心，由客服人员为您申请办理退款事宜。</p>\r\n<p>问：<strong>如果我有问题或建议是否可以通过邮件向你们反馈？</strong></p>\r\n<p>答：可以。商城受理建议或投诉的邮箱是：*****@***.com。</p>', 621, '/html/article_content/201010/cb4b35cc2fd14ddbb20b49d7637fab2f.html', b'1', b'1', b'0', '常见的问题解决方法', '问题', 2, '常见问题', '402881882ba8455f012ba86db8560006');
