	('68568cd84c854bf39878f76399ebe38d', '2015-09-30 08:48:24', NULL, '<p><span style="color: rgb(51, 51, 51); font-family: Arial, 宋体, sans-serif; font-size: 14px; line-height: 25px; background-color: rgb(255, 255, 255);">乔丹体育是中国南方的一家体育用品生产商，前身为成立于1984年的“福建省晋江陈埭溪边日用品二厂”，2000年更名为乔丹体育。2012年2月，飞人乔丹起诉“乔丹体育”涉嫌侵犯其姓名权，引起悍然大波，公司称尚未收到法院应诉通知。2013年4月，乔丹体育方面表示，乔丹的起诉直接导致该公司上市受阻，宣布已起诉乔丹本人“错告侵权”，要求其恢复公司名誉，并索赔800万美金。在研发设计方面，乔丹体育200多人的专业设计团队根植于运动科学研究，以专业的设计研发能力为基础，紧随潮流动态，树立时尚坐标，为每一位热爱运动的人士打造出别具一格、卓然不群的时尚风范。</span></p>', '/upload/image/201509/67411a69a9de4211a9348a1316fceb0c.jpg', '乔丹', 50, 'http://www.qiaodan.com/'),
	('6dfed075066e43dcb355f9fa8d3a6837', '2016-01-15 23:32:13', '2016-06-13 12:22:57', NULL, '/upload/image/201606/eb59ef0a2aef4977843fe84f48a5c55c.jpg', '李宁', 50, 'http://test.com'),
	('85b85945d8ae4eceac44bc753e1b7a84', '2015-01-09 11:23:46', NULL, '<p><span style="color: #333333; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">SKG是一家跨国经营的</span><a style="text-decoration: none; color: #136ec2; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;" href="http://baike.baidu.com/view/6825.htm" target="_blank">互联网</a><span style="color: #333333; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: start; text-indent: 28px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; display: inline !important; float: none; background-color: #ffffff;">家电公司。凭借锐意的改革创新，严苛的产品品质，一流的服务体验，成为中国互联网家电第一品牌；SKG销售网络遍及全球，产品畅销全世界各个国家和地区，为消费者带来健康、时尚的生活方式。</span></p>\r\n<h2 class="headline-1" style="margin: 35px 0px 15px -30px; padding: 0px; font-size: 24px; display: block; font-family: 微软雅黑, 黑体, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; overflow: hidden; position: relative; color: #000000; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background: url(http://baike.bdimg.com/static/lemma/view/img/titleEditLine.png) #ffffff;"><span class="headline-content" style="line-height: 24px; display: block; float: left; padding: 0px 8px 0px 5px; background: #ffffff;">企业文化</span><span class="text_edit editable-title" style="display: block; float: right; padding: 6px 0px 0px 8px; margin-left: 10px; background: #ffffff;"><a class="nslog:1019" style="text-decoration: none; color: #888888; height: 15px; line-height: 16px; padding-left: 18px; font-size: 12px; font-family: 宋体; display: block; background: url(http://baike.bdimg.com/static/lemma/view3/img/icon-view_4b787901.gif) -85px 1px no-repeat transparent;" title="编辑本段" href="http://baike.baidu.com/link?url=5t8oWk7ey9-qStinWP6K2rNc1-8uWZmTRj5QYAY2N1it-bBd_hIWOiXpOSmrDNNE8vfzfmj8wq3GHwG_2J4Ysq">编辑</a></span></h2>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">经营方针：品质、服务、速度</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG精神：开放、简单、包容</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG使命：感动顾客、成就员工</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG企业价值观：用户、改变、奋斗、贡献、伙伴</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG企业目标：成为全球互联网家电NO.1</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG人才观：结果导向，赛马不相马</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">SKG核心竞争力：持续不断地变革创新<sup style="white-space: nowrap; margin-left: 2px; color: #3366cc; cursor: pointer; padding: 0px 2px; position: relative; vertical-align: baseline; top: -0.5em;">[2]</sup></div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">\r\n<h2 class="headline-1" style="margin: 35px 0px 15px -30px; padding: 0px; font-size: 24px; display: block; font-family: 微软雅黑, 黑体, Verdana; font-weight: 500; line-height: 22px; clear: both; zoom: 1; overflow: hidden; position: relative; color: #000000; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background: url(http://baike.bdimg.com/static/lemma/view/img/titleEditLine.png) #ffffff;"><span class="headline-content" style="line-height: 24px; display: block; float: left; padding: 0px 8px 0px 5px; background: #ffffff;">发展历程</span><span class="text_edit editable-title" style="display: block; float: right; padding: 6px 0px 0px 8px; margin-left: 10px; background: #ffffff;"><a class="nslog:1019" style="text-decoration: none; color: #888888; height: 15px; line-height: 16px; padding-left: 18px; font-size: 12px; font-family: 宋体; display: block; background: url(http://baike.bdimg.com/static/lemma/view3/img/icon-view_4b787901.gif) -85px 1px no-repeat transparent;" title="编辑本段" href="http://baike.baidu.com/link?url=5t8oWk7ey9-qStinWP6K2rNc1-8uWZmTRj5QYAY2N1it-bBd_hIWOiXpOSmrDNNE8vfzfmj8wq3GHwG_2J4Ysq">编辑</a></span></h2>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">总部位于中国广东，曾先后在北京，德国，香港等地设立子公司。自进驻<a style="text-decoration: none; color: #136ec2;" href="http://baike.baidu.com/view/6825.htm" target="_blank">互联网</a>渠道以来，其坚持把用户体验(服务)作为第一要务，销售网络已经遍及全球，产品已远销欧美、东南亚等多个国家和地区。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2014年1月，SKG建立广州分公司，杭州分公司，慈溪分公司。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2013年12月，SKG全年销售额5.1亿。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2013年11月，SKG官方论坛正式上线，建立北京分公司</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2013年11月，双十一当天累计成交金额达6206万，<a style="text-decoration: none; color: #136ec2;" href="http://baike.baidu.com/view/10610536.htm" target="_blank">SKG空气净化器</a>8小时突破4000台，获得双十一类目销量冠军，榨汁机开抢2小时，爆售1.5万台，稳居类目第一。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2013年8月SKG与海尔集团旗下青岛日日顺家居服务有限公司正式签署了《全国家电售后服务战略合作协议》，携手打造SKG完美售后服务体系。27500家售后网点，全国联保，覆盖一二线城市，2606个县，20929个乡镇。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2012年12月，SKG全年销售额超2.3亿。</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2012年11月，双十一单日，SKG销售突破1500万，<a style="text-decoration: none; color: #136ec2;" href="http://baike.baidu.com/view/10614976.htm" target="_blank">SKG榨汁机</a>、电水壶类目稳居电子商务小家电市场份额前三;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2012年10月，入选&ldquo;百家商城&rdquo;和&ldquo;广货千家网店&rdquo;的广货网上行企业。同期，入选顺德区电子商务网上商城类示范企业、顺德区容桂总商会理事单位、顺德电子商务协会首届常务副会长单位;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2011年10月，SKG与苏宁签订了&ldquo;SKG共享苏宁全国3C服务中心&rdquo;的协议;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2011年12月，B2C平台年营业额超1.2亿;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2011年2月，SKG成功实现营销体系转型，步入跨国网商;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2010年11月，SKG与美团网，拉手网，24券等大型团购网站合作;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2010年9月，SKG启动线下分销渠道，全面进驻国美、苏宁、家乐福、沃尔玛、易初莲花等全国大型家电卖场及商超;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2010年8月，唯品会8月电器文化节SKG单日销售量过百万元;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2010年4月，SKG进军国际电子商务平台，步入全球销售时代;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2010年2月，SKG被赋予&ldquo;2010年中国电子商务年会&rdquo;最受消费者信赖品牌;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2009年10月，SKG与京东商城达成&ldquo;战略合作伙伴&rdquo;关系;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2008年10月，SKG开启淘宝分销，与淘宝散户共同分享市场;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2008年2月，SKG品牌上线;</div>\r\n<div class="para" style="color: #333333; margin: 15px 0px 5px; text-indent: 2em; line-height: 24px; font-family: arial, 宋体, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; background-color: #ffffff;">2007年2月，SKG公司创立于小家电之都佛山顺德，进军海外电子商务平台，开展跨境电商业务。</div>\r\n</div>', '/upload/image/201501/c9ebc099983142198fdc8d3b3442b59b.jpg', 'SKG', 1, 'http://www.skg.com'),
